                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "While the body of a giant panda looks like that of a bear and the dark circles around its eyes resemble those of a "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "red panda or raccoon, its pupils have vertical slits like the eyes of a cat."
                            },
                            {
                                "characterFormat": {},
                                "text": " Because of the"
                            },
                            {
                                "characterFormat": {},
                                "text": "ir "
                            },
                            {
                                "characterFormat": {},
                                "text": "unusual eyes"
                            },
                            {
                                "characterFormat": {},
                                "text": ", a popular "
                            },
