                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Normal",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "DNA analysis"
                            },
                            {
                                "characterFormat": {},
                                "text": " has put one mystery to rest"
                            },
                            {
                                "characterFormat": {},
                                "text": ". "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "It has revealed that while the red panda is a distant relation, the giant "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "panda's closest relative is the spectacled bear from South America."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Heading 2",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Mostly Vegetarian Diet"
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Normal",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Giant pandas "
                            },
                            {
                                "characterFormat": {},
                                "text": "love"
                            },
                            {
                                "characterFormat": {},
                                "text": " bamboo! In fact, their diet is 99% bamboo. Along with bamboo, they eat other plants, small "
                            },
                            {
                                "characterFormat": {},
                                "text": "rodents, and occasionally fish. The mystery behind their diet is they have the digestive system of a carnivore. "
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Normal",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Their ability to digest bamboo is attributed to tiny microbes that live within their digestive system. "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "As they can only "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "digest about 20% of what they eat, the average giant panda consumes around 14 kilograms (30 pounds) of bamboo "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "a day."
                            },
                            {
                                "characterFormat": {},
                                "text": " In comparison, humans eat about 2 kilograms (5 pounds) of food a day. This enormous diet means the giant "
                            },
                            {
                                "characterFormat": {},
                                "text": "panda spends more than 12 hours a day eating to stay nourished. "
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "beforeSpacing": 7,
                            "styleName": "Normal",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {
                                    "bold": true
                                },
                                "text": "Quick Fact "
                            },
                            {
                                "characterFormat": {},
                                "text": "As the seasons change, the giant panda prefers different species and parts of bamboo."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Heading 2",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Tiny Cubs"
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Normal",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "An infant giant panda cub is about the size of a croissant, weighs less than a teacup and is about 900 times smaller "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "than its mother. "
                            },
                            {
                                "characterFormat": {},
                                "text": "An average adult mother weighs around 91 kilograms (200 pounds) while "
                            },
                            {
                                "characterFormat": {},
                                "text": "newborn weighs"
                            },
                            {
                                "characterFormat": {},
                                "text": " only 83 "
                            },
                            {
                                "characterFormat": {},
                                "text": "to 190 grams (3 to 4 ounces)."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "styleName": "Heading 1",
                            "listFormat": {}
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Other Fun Giant Panda Facts"
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "Researchers have recently discovered that the gene responsible for tasting "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "savory"
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": " or umami "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "flavors"
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": ", such as "
                            },
                            {
                                "characterFormat": {
                                    "fontFamily": "Calibri"
                                },
                                "text": "meat, is inactive in giant pandas."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "For many centuries, giant pandas were thought to be a mythical creature"
                            },
                            {
                                "characterFormat": {},
                                "text": ","
                            },
                            {
                                "characterFormat": {},
                                "text": " "
                            },
                            {
                                "characterFormat": {},
                                "text": "like"
                            },
                            {
                                "characterFormat": {},
                                "text": " a dragon or unicorn"
                            },
                            {
                                "characterFormat": {},
                                "text": "."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Unlike other bears in the region, giant pandas dont hibernate. "
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Giant pandas can stand erect on their hind legs but rarely walk."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "The "
                            },
                            {
                                "characterFormat": {},
                                "text": "Qinling"
                            },
                            {
                                "characterFormat": {},
                                "text": " panda, another giant panda species with a dark brown and light brown coat, live"
                            },
                            {
                                "characterFormat": {},
                                "text": "s"
                            },
                            {
                                "characterFormat": {},
                                "text": " only in the "
                            },
                            {
                                "characterFormat": {},
                                "text": "mountains of Shaanxi. "
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "Giant pandas have very sensitive hearing and smell"
                            },
                            {
                                "characterFormat": {},
                                "text": ","
                            },
                            {
                                "characterFormat": {},
                                "text": " but "
                            },
                            {
                                "characterFormat": {},
                                "text": "they "
                            },
                            {
                                "characterFormat": {},
                                "text": "have poor eyesight."
                            }
                        ]
                    },
                    {
                        "paragraphFormat": {
                            "leftIndent": 28.799999237060547,
                            "styleName": "List Paragraph",
                            "listFormat": {
                                "listId": 1,
                                "listLevelNumber": 0
                            }
                        },
                        "characterFormat": {},
                        "inlines": [
                            {
                                "characterFormat": {},
                                "text": "A newborn giant panda is blind and look"
                            },
                            {
                                "characterFormat": {},
                                "text": "s"
                            },
                            {
                                "characterFormat": {},
                                "text": " like "
                            },
                            {
                                "characterFormat": {},
                                "text": "a "
                            },
                            {
                                "characterFormat": {},
                                "text": "tiny"
                            },
                            {
                                "characterFormat": {},
                                "text": ","
                            },
                            {
                                "characterFormat": {},
                                "text": " pink"
                            },
                            {
                                "characterFormat": {},
                                "text": ","
                            },
                            {
                                "characterFormat": {},
                                "text": " hairless "
